{'sentences': ['First Horizon Corporation has named Martin de Laureal as President of First Horizon Advisors, Inc.', "In his new role, de Laureal's responsibilities include Investment Management, Brokerage, Trust, Financial Planning and Family Office services as well as oversight of the Private Banking team.", 'the Wealth Management subsidiary of First Horizon, and head of Private Banking for the company.



', '"We are thrilled to name Martin head of our Wealth Management business," says Bryan Jordan, Chairman, President, and CEO of First Horizon.', '"



As an active leader in the community, de Laureal has served on numerous nonprofit and civic boards in New Orleans and the Gulf States region.']}
